import { Component } from "react";
const styles = {
    button: {
        backgroundColor: '#e84328', 
        color: '#fff',
        padding: '15px 20px',
        border: 'none',
    }
}

class Button extends Component {
    render() { 
        return (
            <button style={styles.button}{...this.props}></button>
        )
    }
}
export default Button
